{
  "message_name": "UBX-CFG-NAVX5",
  "class_id": "0x06",
  "message_id": "0x23",
  "message_type": "get_set",
  "description": "Navigation engine expert settings",
  "firmware_versions": "u-blox 8/u-blox M8 protocol versions 18, 19, 19.1, 19.2, 20, 20.01, 20.1, 20.2, 20.3, 22, 22.01, 23 and 23.01",
  "payload_length": {
    "fixed": 44
  },
  "fields": [
    {
      "byte_offset": 0,
      "data_type": "U2",
      "name": "version",
      "description": "Message version (0x0003 for this version)",
      "fixed_value": 3
    },
    {
      "byte_offset": 2,
      "data_type": "X2",
      "name": "mask1",
      "description": "First parameters bitmask. Only the flagged parameters will be applied, unused bits must be set to 0. Bitfield: minMax (bit 0-2): 1 = apply min/max SVs settings; minCno (bit 3): 1 = apply minimum C/NO setting; initial3dfix (bit 6): 1 = apply initial 3D fix settings; wknRoll (bit 9-10): 1 = apply GPS weeknumber rollover settings; ackAid (bit 13): 1 = apply assistance acknowledgement settings; PPP (bit 14): 1 = apply usePPP flag; aop (bit 15): 1 = apply aopCfg (useAOP flag) and aopOrbMaxErr settings (AssistNow Autonomous)."
    },
    {
      "byte_offset": 4,
      "data_type": "X4",
      "name": "mask2",
      "description": "Second parameters bitmask. Only the flagged parameters will be applied, unused bits must be set to 0. Bitfield: adr (bit 6): Apply ADR/UDR sensor fusion on/off setting (useAdr flag); sigAttenComp (bit 7): Apply signal attenuation compensation feature settings."
    },
    {
      "byte_offset": 8,
      "data_type": {
        "array_of": "U1",
        "count": 2
      },
      "name": "reserved1",
      "reserved": true
    },
    {
      "byte_offset": 10,
      "data_type": "U1",
      "name": "minSVs",
      "unit": "#SVs",
      "description": "Minimum number of satellites for navigation"
    },
    {
      "byte_offset": 11,
      "data_type": "U1",
      "name": "maxSVs",
      "unit": "#SVs",
      "description": "Maximum number of satellites for navigation"
    },
    {
      "byte_offset": 12,
      "data_type": "U1",
      "name": "minCNO",
      "unit": "dBHz",
      "description": "Minimum satellite signal level for navigation"
    },
    {
      "byte_offset": 13,
      "data_type": "U1",
      "name": "reserved2",
      "reserved": true
    },
    {
      "byte_offset": 14,
      "data_type": "U1",
      "name": "iniFix3D",
      "description": "1 = initial fix must be 3D"
    },
    {
      "byte_offset": 15,
      "data_type": {
        "array_of": "U1",
        "count": 2
      },
      "name": "reserved3",
      "reserved": true
    },
    {
      "byte_offset": 17,
      "data_type": "U1",
      "name": "ackAiding",
      "description": "1 = issue acknowledgements for assistance message input"
    },
    {
      "byte_offset": 18,
      "data_type": "U2",
      "name": "wknRollover",
      "description": "GPS week rollover number; GPS week numbers will be set correctly from this week up to 1024 weeks after this week. Setting this to 0 reverts to firmware default."
    },
    {
      "byte_offset": 20,
      "data_type": "U1",
      "name": "sigAttenCompMode",
      "unit": "dBHz",
      "description": "Only supported on certain products Permanently attenuated signal compensation (0 = disabled, 255 = automatic, 1..63 = maximum expected C/NO value)"
    },
    {
      "byte_offset": 21,
      "data_type": "U1",
      "name": "reserved4",
      "reserved": true
    },
    {
      "byte_offset": 22,
      "data_type": {
        "array_of": "U1",
        "count": 2
      },
      "name": "reserved5",
      "reserved": true
    },
    {
      "byte_offset": 24,
      "data_type": {
        "array_of": "U1",
        "count": 2
      },
      "name": "reserved6",
      "reserved": true
    },
    {
      "byte_offset": 26,
      "data_type": "U1",
      "name": "usePPP",
      "description": "1 = use Precise Point Positioning (only available with the PPP product variant)"
    },
    {
      "byte_offset": 27,
      "data_type": "U1",
      "name": "aopCfg",
      "description": "AssistNow Autonomous configuration. Bitfield: useAOP (bit 0): 1 = enable AssistNow Autonomous."
    },
    {
      "byte_offset": 28,
      "data_type": {
        "array_of": "U1",
        "count": 2
      },
      "name": "reserved7",
      "reserved": true
    },
    {
      "byte_offset": 30,
      "data_type": "U2",
      "name": "aopOrbMaxErr",
      "unit": "m",
      "description": "Maximum acceptable (modeled) AssistNow Autonomous orbit error (valid range = 5..1000, or 0 = reset to firmware default)"
    },
    {
      "byte_offset": 32,
      "data_type": {
        "array_of": "U1",
        "count": 4
      },
      "name": "reserved8",
      "reserved": true
    },
    {
      "byte_offset": 36,
      "data_type": {
        "array_of": "U1",
        "count": 3
      },
      "name": "reserved9",
      "reserved": true
    },
    {
      "byte_offset": 39,
      "data_type": "U1",
      "name": "useAdr",
      "description": "Only supported on certain products Enable/disable ADR/UDR sensor fusion (if 0: sensor fusion is disabled - if 1: sensor fusion is enabled)."
    },
    {
      "byte_offset": 40,
      "data_type": {
        "array_of": "U1",
        "count": 4
      },
      "name": "reserved10",
      "reserved": true,
      "description": "Reserved to fill 44-byte payload length"
    }
  ]
}
